eval("module.exports = JSON.parse(\"{\\\"support.btn\\\":\\\"Допомогти\\\",\\\"main.header.section\\\":\\\"Про нас\\\",\\\"main.header.contact\\\":\\\"Зв'язатися з нами\\\",\\\"main.header.title\\\":\\\"World4life — це незалежна волонтерська платформа взаємодопомоги\\\",\\\"main.header.description\\\":\\\"Кожен з нас може опинитися в складній ситуації. Ми не можемо цього передбачити, але ми ніколи не опиняємося наодинці з труднощами. Бо кожен із нас – це людина з великим серцем, яка може допомогти добрим словом, ділом, професійними знаннями чи поділитися тим, що має в надлишку.\\\",\\\"main.header.timer.dd\\\":\\\"дн.\\\",\\\"main.header.timer.hs\\\":\\\"год.\\\",\\\"main.header.timer.min\\\":\\\"хв.\\\",\\\"main.header.timer.sec\\\":\\\"сек.\\\",\\\"main.more.title\\\":\\\"Докладніше\\\",\\\"main.more.goals\\\":\\\"Які цілі ми ставимо перед World4life?\\\",\\\"main.more.for-whom\\\":\\\"Для кого ми створюємо World4life?\\\",\\\"main.more.description1\\\":\\\"Ми - World4life. Волонтери, які хочуть об’єднати однодумців з усього світу. Щоб кожен міг попросити допомоги зручним способом і отримати її. І щоб кожен, хто прагне покращити цей світ, міг зробити це зручним і доступним способом. Тому що немає великих потреб чи малих можливостей і навпаки, чи не так?\\\",\\\"main.more.description2\\\":\\\"World4life — це платформа для розміщення оголошень про потреби наших користувачів та можливості наших волонтерів. Для зручності ми розподіляємо всі оголошення за категоріями, перелік яких постійно доповнюватиметься. Користувачі можуть повідомити про потребу в житлі, харчових продуктах, транспорті, професійній допомозі — медичній, фінансовій, інформаційній, юридичній та ін. або розмістити інформацію про те, що готовий прихистити, нагодувати, допомогти дістатися місця призначення, проконсультувати того, кому це потрібно.\\\",\\\"main.more.description3\\\":\\\"Ідея створення багатопрофільної волонтерської платформи з’явилася на початку безпрецедентної за розмахом жорстокості та неадекватності російсько-української війни. Вона поділила життя мільйонів українців на «до» та «після». Але всупереч сподіванням ворога ми згуртувалися настільки, що в новому «після» кожен був готовий віддати останнє і знав, що те ж саме для нього зробить хтось інший. Ми згуртували європейську та світову спільноту, і зробимо все, щоби платформа World4life працювала по всьому світу, і кожен у світі знав, що він ніколи не буде самотнім.\\\",\\\"main.quote.title\\\":\\\"Друзі!\\\",\\\"main.quote.description1\\\":\\\"World4life — це суто волонтерський проєкт, який ми створюємо не заради грошей.\\\",\\\"main.quote.description2\\\":\\\"Наша мета — реальна та доступна допомога тим, хто її потребує. Тож якщо ви поділяєте наші цінності та маєте трішки вільного часу, що можете присвятити розвитку World4life, — ласкаво просимо в команду!\\\",\\\"main.vacancies.section\\\":\\\"ВАКАНСІЇ\\\",\\\"main.vacancies.title\\\":\\\"Зараз Ми шукаємо\\\",\\\"main.vacancies.article1\\\":\\\"Розуміння процесу взаємодії з back-end розробником.\\\",\\\"main.vacancies.article2\\\":\\\"Розуміння процесу взаємодії з front-end розробником.\\\",\\\"main.vacancies.article3\\\":\\\"Брати участь у розробці SMM-стратегій та розробляти контент-плани у зв’язці з дизайнером: писати копірайти. Пропонувати ідеї та механіки для контенту (Meta, Google Ads, Telegram). Взаємодіяти з дизайнером у процесі створення візуалів: від брифу до контролю фінального результату. Аналізувати показники і пропонувати способи їхнього поліпшення.\\\",\\\"main.vacancies.article4\\\":\\\"досвід від 3-х років. Глибоке розуміння алгоритмів пошукових систем і факторів ранжування. Знання методів оптимізації та вміння знаходити можливості для зростання проєкту. Розуміння юзабіліті та базові знання HTML/CSS/JS\\\",\\\"main.support.section\\\":\\\"ДОПОМОГА ПРОЕКТУ\\\",\\\"main.support.title\\\":\\\"Нам потрібна будь-яка допомога\\\",\\\"main.support.article1.title\\\":\\\"Волонтер\\\",\\\"main.support.article2.title\\\":\\\"Крутий Волонтер\\\",\\\"main.support.article3.title\\\":\\\"Багатий Волонтер\\\"}\");//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,eyJ2ZXJzaW9uIjozLCJzb3VyY2VzIjpbXSwibmFtZXMiOltdLCJtYXBwaW5ncyI6IiIsImZpbGUiOiIuL3NyYy9pMThuL2xvY2FsZXMvdWFfVUEuanNvbi5qcyIsInNvdXJjZVJvb3QiOiIifQ==\n//# sourceURL=webpack-internal:///./src/i18n/locales/ua_UA.json\n");

